  false,\n\t\"url\": null,\n\t\"notes\": \"The New York City Street Reconstruction
  10 Year Capital Plan identifies capital street projects funded from fiscal years
  2015 to 2025, created by the New York City Department of Transportation. DOT capital
  street projects are major street construction projects, often including full reconstruction
  of the sewer pipes, the roadbed, and sidewalks. Capital projects require detailed
  surveys and design, and increased inter-agency coordination and approvals. They
  are essential to keeping the Cityu2019s infrastructure in a state of good repair.\",\n\t\"license_title\":
